"use strict";

const findLucky = (arr) => {
    const counter = new Map();
    let ans = -1;
    for (let i = 0; i < arr.length; i++) {
        const num = arr[i];
        counter.set(num, (counter.get(num) || 0) + 1);
    }
    for (const [num, n] of counter.entries()) {
        if (num === n && ans < num) {
            ans = num;
        }
    }
    return ans;
};
